import React from 'react';
import './MainSection.css';
const image = process.env.PUBLIC_URL + '/group.jpg';

const MainSection = () => {
    return (
        <div className="main-section">
            <div className="mainsection-tab-container">
                <div className="main-section-content">
                    <div className="maintitle">Welcome to the Harvard Computational Robotics Lab</div>
                    <p>We at the Harvard Computational Robotics Lab study the algorithmic foundations of robot perception, action, and learning. We are broadly interested in estimation and decision-making with performance gurantees.</p>
                    <p><b>Join us</b>: If you are interested in research opportunities at the lab, please fill out this <a href="link-to-application">application survey</a>. </p>
                    <p>This year I am particularly looking for a strong candidate in statistics and machine learning.</p>
                </div>
                <div className="image-container">
                    <img src={image} alt="Stanford Vision and Learning Lab" />
                </div>
            </div>
        </div>
    );
};

export default MainSection;
